import React from "react" ;
import ReactDOM from "react-dom" ;
const Fname = "Pratyush" ;
const Lname = "Shukla" ;
ReactDOM.render(

    <React.Fragment>
        <h1>
            {`Hello My Name Is ${Fname} ${Lname}`}
        </h1>

    </React.Fragment>, 
    document.getElementById("root")

);
